CREATE TABLE `entrada` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `matricula` varchar(10) NOT NULL,
  `base_imponible` int(11) NOT NULL,
  `tipo_de_gravamen` int(11) NOT NULL,
  `id_vendedor` int(11) DEFAULT NULL,
  `id_compraventa` int(11) DEFAULT NULL,
  `id_comprador` int(11) NOT NULL,
  `id_tipo` int(11) NOT NULL,
  `provision` varchar(20) NOT NULL,
  `cobrado` date DEFAULT NULL,
  `fecha_entrada` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `fecha_salida` timestamp NULL DEFAULT NULL,
  `id_usuario` int(11) NOT NULL,
  `correo_ordinario` int(11) NOT NULL DEFAULT '0',
  `tiempo` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id_compraventa` (`id_compraventa`),
  KEY `id_vendedor` (`id_vendedor`),
  KEY `id_comprador` (`id_comprador`),
  KEY `id_tipo` (`id_tipo`),
  KEY `usuario` (`id_usuario`),
  CONSTRAINT `fk_comprador` FOREIGN KEY (`id_comprador`) REFERENCES `cliente` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_compraventa` FOREIGN KEY (`id_compraventa`) REFERENCES `compraventa` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_tipo` FOREIGN KEY (`id_tipo`) REFERENCES `tipos` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_usuario` FOREIGN KEY (`id_usuario`) REFERENCES `usuarios` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_vendendor` FOREIGN KEY (`id_vendedor`) REFERENCES `cliente` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1922 DEFAULT CHARSET=latin1;
